import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  width: 816px;
  margin: 0px 102px 30px 78px;
  text-align: left;

  .profile {
    margin-top: 10px;
  }

  .container {
    display: inline-block;
    border-radius: 10px;
    margin-left: 8px;
    background: #F6F6F6;

  }
`;

const Comment = (props) => {
  return <>
    <Wrapper>
      <img className="profile" src="assets/images/icons/profile.png" alt="profile" />
      <div className="container">
        <span>작성자</span>
        <span>2시간 전</span>
        <span>수정</span>
        <span>삭제</span>
      </div>
    </Wrapper>
  </>;
};

export default Comment;
